import React, { useContext } from "react";
import CssBaseline from '@mui/material/CssBaseline';
import Container from '@mui/material/Container';
import { ColorModeContext } from "../../theme";
import { ThemeProvider, useTheme } from "@mui/material";
import numeral from "numeral";
import { useState, useEffect } from 'react'
import { useParams } from 'react-router-dom';




function Detail(countries, countryInfo, cases) {

  const theme = useTheme();
  const colorMode = useContext(ColorModeContext);

  const [countryInf, setCountryInf] = useState([]);
  const { country } = useParams()


  useEffect(() => {
    const getSingleCountry = async () => {
      try {
        const res = await fetch(`https://disease.sh/v3/covid-19/countries/${country}`)
        const data = await res.json()
        console.log(data)
        setCountryInf(res.data.data)
        console.log(res.data.data)

      } catch (error) {
        console.log(error)

      }
    }
    getSingleCountry();

  }, (country))






  return (
    <ColorModeContext.Provider value={colorMode}>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <Container maxWidth="lg">




          {countryInf?.map((country,index) =>

            <div key={index}>
              {country}


              <div className="info-confirmed">Cases: {numeral(country.cases).format("0,0")}</div>
              <div className="info-recovered">Recovered: {numeral(country.recovered).format("0,0")}</div>
              <div className="info-deaths">Deaths: {numeral(country.deaths).format("0,0")}</div>


            </div>



          )}

          {country}
          {numeral(country.cases).format("0,0")}
          {countryInf.cases}
          {/* {country.countryInfo.flag} */}

          <div className="info-container">
            {/* <div className="info-flag" style={{backgroundImage: `url(${country.countryInfo.flag})`}} /> */}
            <div className="info-confirmed">Cases: {numeral(country.cases).format("0,0")}</div>
            <div className="info-recovered">Recovered: {numeral(country.recovered).format("0,0")}</div>
            <div className="info-deaths">Deaths: {numeral(country.deaths).format("0,0")}</div>
          </div>

        </Container>

      </ThemeProvider>
    </ColorModeContext.Provider>
  )

}


const CountryInfo = () => {
  const [country, setCountry] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState("");

  const { countryCode } = useParams();

  const borders = country.map((country) => country.borders);

  useEffect(() => {
      const getCountryByCode = async () => {
          try {
              const res = await fetch(`http://ballseer.com/seer/api/country/getbyCode/${countryCode}`,
                  {
                      method: "GET",

                      headers: {
                          'Authorization': `Bearer ${sessionStorage.getItem('access_token')}`,
                      },
                  });

              if (!res.ok) throw new Error("Could not found!");

              const data = await res.json();

              setCountry(data);
              setIsLoading(false);
          } catch (error) {
              setIsLoading(false);
              setError(error.message);
          }
      };

      console.log(countryCode);
      getCountryByCode();
  }, [countryCode]);

  return (
      <div className="country__info__wrapper">
          <button>
              <Link to="/">Back</Link>
          </button>

          {isLoading && !error && <h4>Loading........</h4>}
          {error && !isLoading && { error }}

          {country?.map((country, index) => (
              <div  key={index}>
                  <div >
                      <img src={country.flag} alt="" />
                  </div>

                  <div >
                      <h3>{country.name}</h3>

                      <div >

                          <h5>
                              code: <span>{country.code}</span>
                          </h5>
                          {/*<h5>*/}
                          {/*    id: <span>{country.id}</span>*/}
                          {/*</h5>*/}

                      </div>
                  </div>
              </div>
          ))}
      </div>
  );
};

export default Detail;
